import React from "react";
import CommonSection from "../shared/CommonSection";

import "../styles/tour.css";


import SearchBar from "./../shared/SearchBar";
import Newsletter from "./../shared/Newsletter";
import { Col, Container, Row } from "reactstrap";
import heroImg from "../assets/images/hero-img01.jpg";
import worldImg from "../assets/images/world.png";
import Subtitle from "../shared/Subtitle";

const About = () => {
  return (
    <>
      <CommonSection title={"About"} />
      <section>
        <Container>
          <Row>
            
          </Row>
        </Container>
      </section>
    
    <section className="pt-5">
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtitle d-flex align-items-center">
                  <Subtitle subtitle={"Know Before You Go"} />
                  <img src={worldImg} alt="" />
                </div>
                <h1>
                Discover Our Passion for Travel
                  <span className="highlight">memories</span>
                </h1>
                <p>
                  Lorem ipsum dolor sit amet consectetur, adipisicing elit.
                  Ullam ipsum nobis asperiored soluta voluptas quas voluptates.
                  Molestiae tempora dignissimos, animi praesentiium molestias
                  perferendis porro expedita delectus.Soluta natus porro.
                </p>
              </div>
            </Col>

            <Col lg="6">
              <div className="hero__img-box">
                <img src={heroImg} alt="" />
              </div>
            </Col>
          </Row>
        </Container>
      </section>

      <Newsletter />
    </>
  );
};

export default About;
